import React from "react";
import Myauto from "./myauto";
import Header from "./header";
import Navbar from "./navbar";
import Main from "./main";
import data4 from "./data4.json";
import Filter from "./Filter";
import "./App1.css";
import "./App.css";

function App() {
  let IDs: number[] = [
    91350842, 92060138, 91347734, 92836546, 92835750, 86946439, 85990507,
    91282763,
  ];
  const items: object[] = data4.data.items;

  return (
    <>
      <Header />
      <Myauto />
      <Filter />
      <Navbar />
      <Main IDs={IDs} />
    </>
  );
}

export default App;
